public int hashCode() {
  final int prime = 31;
  int result = 1;
  result = prime * result + ((compareOp == null) ? 0 : compareOp.hashCode());
  result = prime * result + ((prefix == null) ? 0 : prefix.hashCode());
  return result;
}
